An epic 1970s tale about a group of rebel rock bands who 
rose up from one of the most unpopular, marginalised parts 
of the USA - the Deep South - and conquered the world.

The Allman Brothers, Lynyrd Skynyrd and others that followed 
did this entirely on their own terms, blending the music of 
the region - blues, country, rock and roll - with a gung-ho 
attitude that set the South, and then America, on fire.

Their diverse styles, from juke joint boogie and country-rock 
honks to cosmic blues blasts, had a huge cultural 
and political impact, even helping to elect Jimmy Carter as 
president in 1976.

Their extraordinary adventure is brought to life through vivid 
period archive and contributions from the survivors of those 
crazy times, including Gregg Allman, REM's Mike Mills, Doug 
Gray, Al Kooper, Bonnie Bramlett, Charlie Daniels and other 
key figures in the movement

